package Recursion;

public class ReverseANumber {
    private static void rev(StringBuilder sb, int l, int r) {
        if (l >= r) {
            return;
        }

        char frontDigit = sb.charAt(l);
        char lastDigit = sb.charAt(r);
        sb.setCharAt(l, lastDigit);
        sb.setCharAt(r, frontDigit);
        rev(sb, l+1, r-1);
    }
    public static void main(String[] args) {
//        String str1 = "";
        String str1 = "";
//        int n = 3421;
        StringBuilder sb = new StringBuilder(str1);
        rev(sb, 0, str1.length()-1);
        System.out.println(sb);
//        System.out.println(str1);
    }
}
